import React from "react"
import ReactDOM from "react-dom"

import Friend from "./Friend"
//import Pet from "./Pet"
import friendsList from "./friends-with-pets/friendsList"

function App() {
    const rolladex = friendsList.map(item1 => <Friend person={item1} />)

    return (
        <div>
            {rolladex}
        </div>
    )

}

export default App
